import {BrowserRouter,Routes,Route} from 'react-router-dom'
import Home from './Home';
import Payment from '.';

function App() {
  return (
   <>
   <BrowserRouter>
   <Routes>

<Route path = '/' element  = {<Home/>}/>
<Route path = '/paymentsuccess' element  = {<Payment/>}/>

   </Routes>



   </BrowserRouter>

   </>
  );
}

export default App;
